import React, { useState, useEffect } from 'react'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'
import Table from 'react-bootstrap/Table'

function History() {
  const [History, setHistory] = useState([]);
  const [Loading, setLoading] = useState(false);
  const firebaseRef = firebase.firestore().collection("History");

  useEffect(() => {
    function getHistory() {
      setLoading(true);
      firebaseRef.get().then((item) => {
        const items = item.docs.map((doc) => doc.data());
        setHistory(items);
        setLoading(false);
      });
    }
    getHistory();
  }, []);
  console.log(History);


  const renderHistory = () => {
    return (
      <Container >
        <Table striped bordered hover size="lg">
          <tr>
            <thead>
              <th scope="col">Start</th>
              <th scope="col">End</th>
              <th scope="col">Prime count</th>
              <th scope="col">Prime number</th>
              <th>timestamp</th>
            </thead>
            <tbody >
              {History.map((item, i) => (
                <tr key={i}>
                  <td>{item.start}</td>
                  <td>{item.end}</td>
                  <td>{item.cntprime}</td>
                  <td>{item.prime}</td>
                  <td>{`${item.timestamp}`}</td>
                </tr>
              ))}
            </tbody>
          </tr>
        </Table>



      </Container>
    );
  };

  return (

    <Container>
      <h1>History</h1>
      <div>{renderHistory()}</div>
    </Container>
  )
}

export default History
